 our side. The program however still does the same thing. Just installing a library is not going to make our program generate random numbers. The simplest way to start with it is to use rand::random(): fn main() { let randnum: i64 = rand::random(); println!("Hello world: {}", randnum);
} We need to define the type of randnum this time. The reason is that this library detects where we want to save it and creates a random number as big as possible that does fit. The result is: deavid@debian:~/git/rust/learnrust$ cargo run Finished dev [unoptimized + debuginfo] target(s) in 0.00s Running `target/debug/learnrust` Hello world: 1976599895379426978 deavid@debian:~/git/rust/learnrust$ cargo run Finished dev [unoptimized + debuginfo] target(s) in 0.00s Running `target/debug/learnrust` Hello world: -2920297650750248329 deavid@debian:~/git/rust/learnrust$ cargo run Finished dev [unoptimized + debuginfo] target(s) in 0.00s Running `target/debug/learnrust` Hello world: 8971769657686972258 deavid@debian:~/git/rust/learnrust$ cargo run Finished dev [unoptimized + debuginfo] target(s) in 0.00s Running `target/debug/learnrust` Hello world: -8688429354790802443 As we can see it creates very big numbers, both positive and negative. A different random number will be generated in each run. We could make the number non-negative and smaller by choosing u8 instead of i64: let randnum: u8 = rand::random(); This creates the following results: Hello world: 140 Hello world: 215 Hello world: 99 Hello world: 221 Because u8 is unsigned and can hold numbers between 0 and 255 \((2^8-1)\), this is the range that we get. We can instead ask this library for a specific range: use rand::Rng; fn main() { let mut rng = rand::thread_rng(); let randnum: i64 = rng.gen_range(1..=100); println!("Hello world: {}", randnum);
} In this case we need to create a random number generator object rng. This will be holding the internal state of the random generator. It needs to be mutable because the state changes as each number is generated, so the numbers aren't repeated every time. The gen_range(1..=100) specifies which range of numbers to retrieve, like in a for loop, but in this case we only get a single number, randomly. The use rand::Rng on the top is needed to access the gen_range method. This is what Rust calls a Trait. We will go over these later on. Of course, don't go crazy and import the whole site. It's not a race to see who imports more crates. Also, as you gain more experience you should be able to keep the number of imported libraries low.

