Something that is little known is that in programming we have an operator to get the remainder of a division. For example, if we do 12 / 10 = 1, but the remainder of that division is 2. To get the remainder we use the modulo operator %: let v = 35;
let b = 10;
let remainder = v % b;
println!("{} % {} = {}", v, b, remainder); This operator is useful when we want a value that wraps around a particular number. For example when counting time, seconds goes to 60, then back to zero. So if we do: let time_sec = 100322;
let seconds = time_sec % 60; It will make the seconds variable to be on the range 0…60, excluding 60. This, with the use of divisions, it can make for a very easy code to transform a lot of seconds into hours, minutes, and seconds. Here's the recipe. let time_sec = 100322;
let seconds = (time_sec) % 60;
let minutes = (time_sec / 60) % 60;
let hours = (time_sec / 60 / 60) % 24;
let days = (time_sec / 24 / 60 / 60) % 30;
let months = (time_sec / 30 / 24 / 60 / 60) % 12;
let years = (time_sec / 12 / 30 / 24 / 60 / 60); NOTE: The operator actually computes the modulo, not the remainder, which is almost the same, but not identical. For negative values it behaves differently.

